import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Form() {

    const items = []

    const teamdata = async() =>{

        const dd = await axios.get('/api/team');

        for (const [index, value] of dd.data.entries()) {
            items.push(value.name)
            // console.log(value.name);
        }
        
    }

    useEffect(() => {
        document.title = 'from';

        teamdata();
    });

    console.log(items);

    

    const elements = ['one', 'two', 'three','one', 'two', 'three'];

    const itemss = []

    for (const [index, value] of elements.entries()) {
        itemss.push(<div>{value}</div>)
    }

    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
            {items}
        </>
    )
}

export default Form
